import React from 'react';
import styled from 'styled-components';


const Background = styled.main
`
padding: 1920px;
border-color: papayawhip;
background: papayawhip;

`


class Loginpage extends React.Component{
    render(){
        return(
            
        <Background>
            <p>back</p>
        </Background>
           
        );
    }
}

export default Loginpage;
